import React from 'react';

function About(){
    return (
        <div className="About">
            <p>
                <h1>Who we are?</h1><br/>

                DMV Tech Services is an IT Service provider company,
                registered in May-2019.<br/><br/>

                We are providing IT Services to Personal users as well as,
                various Corporate sectors like Education, Manufacturing Industries,
                Facility Service industry, Civil industry, Architecture Offices.<br/><br/>

                @ PUNE | TALEGOAN | LONAVLA
            </p>
        </div>
    );
}

export default About;
